import React from "react";

import "../styles/styles.scss";

const MenuItem = props => {
  const { title } = props;
  return (
    <div className="menu-item">
      <div className="content">
        <h1 className="title">{title}</h1>
        <span className="subtitle">SHOP NOW</span>
      </div>
    </div>
  );
};

export default MenuItem;
